import { withRouter } from 'react-router-dom'
import {Route,Switch,Link}  from 'react-router-dom';
function Form() {
    return (
        <>
        <Route exact path='/form' component={Form}></Route>
        <input type='number' placeholder='enter id'></input><br></br>
        <input type='text' placeholder='enter user-id'></input><br></br>
        <input type='text' placeholder='enter title'></input><br></br>
        <input type='text' placeholder='enter body'></input><br></br>
        <a href=''>create</a>

       </>    
)
}
export default withRouter(Form);
